pragma solidity ^0.8.0;

import '@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol';
import '@openzeppelin/contracts/access/Ownable.sol';
import './SalesActivation.sol';

contract EggFounder is ERC721Enumerable, Ownable, SalesActivation {

    // base URI
    string public baseTokenURI;
    // Price of each Egg Founder
    uint256 public price;
    // First Presale Price of each Egg Founder
    uint256 public firstPresalePrice;
    // Second Presale Price of each Egg Founder
    uint256 public secondPresalePrice;
    // Maximum amount of Egg Founder 
    uint256 public total_eggs = 6666;
    // Maximum amount giveaways
    uint256 public max_giveaway = 66;
    // Presale max mint 
    uint256 public presaleListMax = 4;
    // Presale max mint 
    uint256 public maxMint = 20;
    // Presale whitelist 1 
    uint256 public presaleFirstWhitelist = 666;
    // Presale whitelist 2 
    uint256 public presaleSecondWhitelist = 1111;
    // First Presale list
    mapping(address => bool) public firstPresaleList;
    // Second Presale list
    mapping(address => bool) public secondPresaleList;
    // First Presale claimed
    address[] public addressFirstPresaleListClaimed;
    mapping(address => uint256) public firstPresaleListClaimed;
    // Second Presale claimed
    address[] public addressSecondPresaleListClaimed;
    mapping(address => uint256) public secondPresaleListClaimed;

    // Withdraw Address
    address commission_1 = 0x768046A4959B7c9f95e410490d9438648238D5BF ;
    address commission_2 = 0x56f10A60BE53BB972493f60c83f8EA90060014b6 ;
    address luke_crypto = 0x799CD72D86A6AA46876C2689A13637Cbe6ae89da;
    address marketing = 0x8C8B46e1a7043D7d174e680f2C84f425a46fE0D5;
    address guy_buy_die  = 0xc0262EdD5DDC5a036a8859447dFEe9A50F6856f4;


    constructor(string memory tokenURI, uint256 _publicSalesStartTime, uint256 _firstPreSalesStartTime, 
    uint256 _firstPreSalesEndTime,uint256 _secondPreSalesStartTime,uint256 _secondPreSalesEndTime) 
    ERC721("Egg Founder", "EGG") 
    SalesActivation(_publicSalesStartTime,_firstPreSalesStartTime,_firstPreSalesEndTime,
    _secondPreSalesStartTime,_secondPreSalesEndTime){
        setBaseURI(tokenURI);
    }

    /**
    * @dev Mint EggFounder
    */
    function mint(uint256 eggNumber) public payable isPublicSalesActive{
        uint256 supply = totalSupply();
        require( msg.value >= price * eggNumber,             "Ether sent is not correct" );
        require( supply + eggNumber <= total_eggs - max_giveaway ,      "Exceeds maximum EggFounder supply" );
        require(eggNumber > 0, "You cannot mint 0 EggFounder");
        require(eggNumber <= maxMint, "You are not allowed to buy this many EggFounder at once");

        for(uint256 i; i < eggNumber; i++){
            _safeMint( msg.sender, supply + i );
        }
    }

    /**
    * @dev Presale EggFounder 1
    */
    function firstPresale(uint256 eggNumber) public payable isFirstPreSalesActive{
        uint256 supply = totalSupply();
        require(firstPresaleList[msg.sender], 'You are not on the Whitelist');
        require( eggNumber <= presaleFirstWhitelist, 'Exceeds maximum First presale supply');
        require( supply + eggNumber <= total_eggs - max_giveaway , "Exceeds maximum EggFounder supply" );
        require(eggNumber <= presaleListMax, 'Cannot purchase this many EggFounder');
        require(firstPresaleListClaimed[msg.sender] + eggNumber <= presaleListMax, 'Purchase exceeds max allowed');
        require( msg.value >= firstPresalePrice * eggNumber,             "Ether sent is not correct" );
        require(eggNumber > 0, "You cannot mint 0 EggFounder");

        for (uint256 i = 0; i < eggNumber; i++) {
            firstPresaleListClaimed[msg.sender] += 1;
            _safeMint(msg.sender, supply + i);
            presaleFirstWhitelist -= 1;
        }
    }

    /**
    * @dev Presale EggFounder 2
    */
    function secondPresale(uint256 eggNumber) public payable isSecondPreSalesActive{
        uint256 supply = totalSupply();
        require(secondPresaleList[msg.sender], 'You are not on the Whitelist');
        require(eggNumber <= presaleSecondWhitelist, 'Exceeds maximum Second presale supply');
        require( supply + eggNumber <= total_eggs - max_giveaway ,      "Exceeds maximum EggFounder supply" );
        require(eggNumber <= presaleListMax, 'Cannot purchase this many EggFounder');
        require(secondPresaleListClaimed[msg.sender] + eggNumber <= presaleListMax, 'Purchase exceeds max allowed');
        require( msg.value >= secondPresalePrice * eggNumber,             "Ether sent is not correct" );
        require(eggNumber > 0, "You cannot mint 0 EggFounder");

        for (uint256 i = 0; i < eggNumber; i++) {
            secondPresaleListClaimed[msg.sender] += 1;
            _safeMint(msg.sender, supply + i);
            presaleSecondWhitelist -= 1;
        }
    }



    /**
    * @dev Give away (Callable by owner only)
    */
    function giveAway(address _to, uint256 _amount) external onlyOwner() {
        uint256 supply = totalSupply();
        require( _amount <= max_giveaway,      "Exceeds maximum EggFounder giveaway" );

        for(uint256 i; i < _amount; i++){
            _safeMint( _to, supply + i );
        }

        max_giveaway -= _amount;
    }

    /**
    * @dev Owner Mint EggFounder
    */
    function ownerMint(address _to,uint256 eggNumber) external onlyOwner() {
        uint256 supply = totalSupply();
        require( supply + eggNumber <= total_eggs - max_giveaway,      "Exceeds maximum EggFounder supply" );

        for(uint256 i; i < eggNumber; i++){
            _safeMint( _to, supply + i );
        }
    }

    /**
    * @dev Reset the first presale list
    */
    function resetFirstPresaleListClaimed() public onlyOwner {
        for (uint i=0; i< addressFirstPresaleListClaimed.length ; i++){
            firstPresaleList[addressFirstPresaleListClaimed[i]] = false;
            firstPresaleListClaimed[addressFirstPresaleListClaimed[i]] = 0;
        }
        delete addressFirstPresaleListClaimed;
    }

    /**
    * @dev Reset the second presale list
    */
    function resetSecondPresaleListClaimed() public onlyOwner {
        for (uint i=0; i< addressSecondPresaleListClaimed.length ; i++){
            secondPresaleList[addressSecondPresaleListClaimed[i]] = false;
            secondPresaleListClaimed[addressSecondPresaleListClaimed[i]] = 0;
        }
        delete addressSecondPresaleListClaimed;
    }

    /**
    * @dev Add people to First Presale List
    */
    function addToFirstPresaleList(address[] calldata presaleList) public onlyOwner {
        for (uint256 i = 0; i < presaleList.length; i++) {
            addressFirstPresaleListClaimed.push(presaleList[i]);
            firstPresaleList[presaleList[i]] = true;
            firstPresaleListClaimed[presaleList[i]] > 0 ? firstPresaleListClaimed[presaleList[i]] : 0;
        }
    }

    /**
    * @dev Add people to Second Presale List
    */
    function addToSecondPresaleList(address[] calldata presaleList) public onlyOwner {
        for (uint256 i = 0; i < presaleList.length; i++) {
            addressSecondPresaleListClaimed.push(presaleList[i]);
            secondPresaleList[presaleList[i]] = true;
            secondPresaleListClaimed[presaleList[i]] > 0 ? secondPresaleListClaimed[presaleList[i]] : 0;
        }
    }

    /**
    * @dev Check if you are in First Presale List
    */
    function onFirstPresaleList(address presaleCheck) public view returns (bool) {
        return firstPresaleList[presaleCheck];
    }

    /**
    * @dev Check if you are in Second Presale List
    */
    function onSecondPresaleList(address presaleCheck) public view returns (bool) {
        return secondPresaleList[presaleCheck];
    }

    /**
    * @dev Remove people from First Presale List
    */
    function removeFromFirstWhitelist(address[] calldata removeList) public onlyOwner {
        for (uint256 i = 0; i < removeList.length; i++) {
            firstPresaleList[removeList[i]] = false;
        }
    }

    /**
    * @dev Remove people from Second Presale List
    */
    function removeFromSecondWhitelist(address[] calldata removeList) public onlyOwner {
        for (uint256 i = 0; i < removeList.length; i++) {
            secondPresaleList[removeList[i]] = false;
        }
    }

    /**
    * @dev Check how many is claimed already in first Presale for specific owner
    */
    function firstPresaleListClaimedBy(address owner) public view returns (uint256){
        return firstPresaleListClaimed[owner];
    }

    /**
    * @dev Check how many is claimed already in second Presale for specific owner
    */
    function secondPresaleListClaimedBy(address owner) public view returns (uint256){
        return secondPresaleListClaimed[owner];
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return baseTokenURI;
    }

    /**
    * @dev Change the base URI 
    */
    function setBaseURI(string memory baseURI) public onlyOwner {
        baseTokenURI = baseURI;
    }

    /**
    * @dev Change the total EggFounder
    */
    function setTotalEggFounder(uint256 totalEggFounder) public onlyOwner {
        total_eggs = totalEggFounder;
    }

    /**
    * @dev Change the presale list max number
    */
    function setpresaleListMax(uint256 maxPresaleListMax) public onlyOwner {
        presaleListMax = maxPresaleListMax;
    }

    /**
    * @dev Change the max giveaway number
    */
    function setMaxGiveaway(uint256 _giveaway) public onlyOwner {
        max_giveaway = _giveaway;
    }

    /**
    * @dev Change the mint max number
    */
    function setMintMax(uint256 _maxMint) public onlyOwner {
        maxMint = _maxMint;
    }


    /**
    * @dev Get all tokens of a owner provided
    */
    function getTokensOfOwner(address _owner) public view returns(uint256[] memory) {
        uint256 tokenCount = balanceOf(_owner);

        uint256[] memory tokensId = new uint256[](tokenCount);
        for(uint256 i; i < tokenCount; i++){
            tokensId[i] = tokenOfOwnerByIndex(_owner, i);
        }
        return tokensId;
    }

    /**
    * @dev Set Price 
    */
    function setPrice(uint256 _newPrice) public onlyOwner {
        price = _newPrice;
    }

    /**
    * @dev Set First Presale Count 
    */
    function setFirstPresaleCount(uint256 _count) public onlyOwner {
        presaleFirstWhitelist = _count;
    }


    /**
    * @dev Set Second Presale Count 
    */
    function setSecondPresaleCount(uint256 _count) public onlyOwner {
        presaleSecondWhitelist = _count;
    }

    /**
    * @dev Set First Presale Price 
    */
    function setFirstPresalePrice(uint256 _newPrice) public onlyOwner {
        firstPresalePrice = _newPrice;
    }

    /**
    * @dev Set Second Presale Price 
    */
    function setSecondPresalePrice(uint256 _newPrice) public onlyOwner {
        secondPresalePrice = _newPrice;
    }

    /**
    * @dev Set Commission address
    */
    function setCommission1(address _commission) public onlyOwner {
        commission_1 = _commission;
    }

    /**
    * @dev Set Commission address
    */
    function setCommission2(address _commission) public onlyOwner {
        commission_2 = _commission;
    }

    /**
    * @dev Set Marketing address
    */
    function setMarketing(address _marketing) public onlyOwner {
        marketing = _marketing;
    }

    /**
    * @dev Set GuyBuyDie address
    */
    function setGuyBuyDie(address _guy_buy_die) public onlyOwner {
        guy_buy_die = _guy_buy_die;
    }

    /**
    * @dev Withdraw 
    */
    function withdraw() onlyOwner public {
        uint256 _balance = address(this).balance;
        require(payable(commission_1).send((_balance*2)/100));
        require(payable(commission_2).send((_balance*2)/100));
        require(payable(luke_crypto).send((_balance*3)/100));
        require(payable(marketing).send((_balance*3)/100));
        require(payable(guy_buy_die).send((_balance*90)/100));
    }
}
