// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";

contract SalesActivation is Ownable {
    // Public sales start time
    uint256 public publicSalesStartTime;
    // first presales start time
    uint256 public firstPreSalesStartTime;
    // first presales end time
    uint256 public firstPreSalesEndTime;
    // second presales start time
    uint256 public secondPreSalesStartTime;
    // second presales end time
    uint256 public secondPreSalesEndTime;

    modifier isPublicSalesActive() {
        require(
            isPublicSalesActivated(),
            "Public sales not started"
        );
        _;
    }

    modifier isFirstPreSalesActive() {
        require(
            isFirstPreSalesActivated(),
            "Presales not started"
        );
        _;
    }

    modifier isSecondPreSalesActive() {
        require(
            isSecondPreSalesActivated(),
            "Presales not started"
        );
        _;
    }

    constructor(uint256 _publicSalesStartTime, uint256 _preSalesStartTime, uint256 _preSalesEndTime,
                uint256 _secondPreSalesStartTime, uint256 _secondPreSalesEndTime) {
        publicSalesStartTime = _publicSalesStartTime;
        firstPreSalesEndTime = _preSalesEndTime;
        firstPreSalesStartTime = _preSalesStartTime;
        secondPreSalesEndTime = _secondPreSalesEndTime;
        secondPreSalesStartTime = _secondPreSalesStartTime;
    }

    function isPublicSalesActivated() public view returns (bool) {
        return
            publicSalesStartTime > 0 && block.timestamp >= publicSalesStartTime;
    }

    function setPublicSalesTime(uint256 _startTime) external onlyOwner {
        publicSalesStartTime = _startTime;
    }

    function isFirstPreSalesActivated() public view returns (bool) {
        return
            firstPreSalesStartTime > 0 &&
            firstPreSalesEndTime > 0 &&
            block.timestamp >= firstPreSalesStartTime &&
            block.timestamp <= firstPreSalesEndTime;
    }

    function isSecondPreSalesActivated() public view returns (bool) {
        return
            secondPreSalesStartTime > 0 &&
            secondPreSalesEndTime > 0 &&
            block.timestamp >= secondPreSalesStartTime &&
            block.timestamp <= secondPreSalesEndTime;
    }

    function setFirstPreSalesTime(uint256 _startTime, uint256 _endTime)
        external
        onlyOwner
    {
        require(
            _endTime >= _startTime,
            "PreSalesActivation: End time should be later than start time"
        );
        firstPreSalesStartTime = _startTime;
        firstPreSalesEndTime = _endTime;
    }

    function setSecondPreSalesTime(uint256 _startTime, uint256 _endTime)
        external
        onlyOwner
    {
        require(
            _endTime >= _startTime,
            "PreSalesActivation: End time should be later than start time"
        );
        secondPreSalesStartTime = _startTime;
        secondPreSalesEndTime = _endTime;
    }
}"
